import React, { Component } from 'react';
import '../stylesheets/App.css';
import { ListGroup, Pagination } from 'react-bootstrap';
import { NavLink } from 'react-router-dom'
import Footer from "../components/Footer.js"
import NavHeader from "../components/NavHeader.js"

let active = 1;
let forms = [<BasicInfo />];
let formTitles = ["Profile", "Identity Verification"]
for (let number = 1; number <= 2; number++) {
  forms.push(
    <Pagination.Item key={formTitles[number]} active={formTitles[number] === active}>
      {number}
    </Pagination.Item>,
  );
}

function SignupSidebar(props) {
  return (
    <ListGroup defaultActiveKey="#link1">
      <ListGroup.Item action href="#link1">
        Link 1
    </ListGroup.Item>
      <ListGroup.Item action href="#link2" disabled>
        Link 2
    </ListGroup.Item>
      <ListGroup.Item action>This one is a button</ListGroup.Item>
    </ListGroup>
  );
}

function BasicInfo(props) {
  return (
    <div>
      <h1>PAGE 1</h1>
    </div>
  )
}

class Signup extends Component {
  render() {
    return (
      <div id = "Signup" className="Signup">
      <NavHeader />
      <Pagination>{forms}</Pagination>
        <Footer />
      </div>
    );
  }
}

export default Signup;
